import React from 'react';
import { Link } from 'react-router-dom';
import './home.scss';

const Home = () => {
    return (
        <div>
            <div className="lignes">
                <div class="l1"></div>
                <div class="l3"></div>
            </div>

            <div className="container-first">
                <h1><span>You </span><span>need </span><span>some </span><span>Rest</span></h1>
                <div class="container-btns">
                    <button class="btn-first b1"></button>
                    <button class="btn-first b2"></button>
                </div>

                <ul className="medias">
                    <li class="bulle"><img src='/images/Facebook.png'className='logo-medias'/></li>
                    <li class="bulle"><img src='/images/Instagram.png'className='logo-medias'/></li>
                    <li class="bulle"><img src='/images/YouTube.png'className='logo-medias'/></li>
                </ul>
            </div>

        </div>

    )
}

export default Home;
